import React from 'react';
import { Nav } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap';
import { Link } from 'react-router-dom';
const CheckoutSteps = ({ step1, step2, step3, step4 }) => {
  return (
          //   <LinkContainer> <Nav.Link to='/login'>Sign In</Nav.Link> </LinkContainer>
          // <LinkContainer> <Nav.Link to='/shipping'>Shipping</Nav.Link> </LinkContainer>
          //  <LinkContainer> <Nav.Link to='/payment'>Payment</Nav.Link> </LinkContainer>
    <Nav className='justify-content-center mb-4'>
      <Nav.Item>
        {step1 ? (
            <Link  to={'/login'} >Sign In</Link>


        ) : (
          <Nav.Link disabled>Sign In</Nav.Link>
        )}
      </Nav.Item>

      <Nav.Item>
        {step2 ? (
            <Link  to={'/shipping'} >Shipping </Link>


        ) : (
          <Nav.Link disabled>Shipping</Nav.Link>
        )}
      </Nav.Item>

      <Nav.Item>
        {step3 ? (
            <Link  to={'/payment'} >payment </Link>

        ) : (
          <Nav.Link disabled>Payment</Nav.Link>
        )}
      </Nav.Item>

      <Nav.Item>
        {step4 ? (

            <LinkContainer>
              <Nav.Link to='/placeorder'>Place order</Nav.Link>
            </LinkContainer>

        ) : (
          <Nav.Link disabled>Place order</Nav.Link>
        )}
      </Nav.Item>
    </Nav>
  );
};

export default CheckoutSteps;
